// src/Output.js
import React from 'react';

const Output = ({ recommendations }) => {
 return (
    <div>
      <h2>You may like these ðŸ¤—</h2>
      <div className="container">
        <div id="recommendations" className="projcard-container">
          {recommendations.map((recommendation, index) => (
            <div key={index} className="projcard projcard-blue">
              <div className="projcard-innerbox">
                <img className="projcard-img" src={recommendation.image} alt={recommendation.food} />
                <div className="projcard-textbox">
                 <div className="projcard-title">{recommendation.food}</div>
                 <div className="projcard-subtitle">Source: <a href={recommendation.sourceUrl} target="_blank">{recommendation.sourceUrl}</a></div>
                 <div className="projcard-bar"></div>
                 <div className="projcard-description">Instructions: {recommendation.instructions} <a href="#" className="read-more">Read more</a></div>
                 <div className="projcard-tagbox">
                    <span className="projcard-tag">{recommendation.ingredients.join(', ')}</span>
                 </div>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
 );
};

export default Output;
